node.text:
تزامناً مع يوم زايد للعمل الإنساني وبمشاركة كوكبة مميزة من النجوم والمبدعين، يسعدني اليوم أن أطلق وعلى بركة الله تعالى "حملة جود 2020" بالتعاون مع هيئة الاعمال الخيرية؛ مستهدفين جمع 100 مليون درهم لمبادرات أساسية كتوفير: السلال الغذائية والمير الرمضاني، والدواء لأصحاب الأمراض المزمنة، ودعم مرضى الفشل الكلوي، و الطرود الغذائية و إفطار القرى الفقيرة وغيرها من المبادرات الإنسانية . آملين أن نرسم بسمة جديدة على وجوه الفقراء والمحتاجين .

نجود جميعاً ليعم الخير ✨

